        Dear Johanna, my sweet love.


        Im sorry that im forced to write to you like this.


        I used up all my supplies , the botanics are oversatured , the water filter is corroded, and the deep nebula has sorrounded me.


        The atmosphere got breached , the whole ship is cold, my suit's oxygen is low and the canister's almost empty, blinking with a unnerving dying red.


        I can't feed myself anymore , and i know rescue isn't coming, the storm has been going for far longer than anyone expected.


        I've made the choice to walk into the deep purple nebula, i know well enough that we will never see eachother again.


        Do not try to search for me, i've left all the research data in the protocol closet with the last of my batteries attached to protect the research, its yours to decipher now.


        Im at peace. Please forgive me , Johanna, don't search for me, and don't lose hope in the project. Love, your one and only Headwood.

